import React from 'react'
import styled from 'styled-components';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome'
import { faPlusSquare } from '@fortawesome/free-solid-svg-icons'
//Use react router to make the button go to a new route that renders the CreateWorker.js Component

const AddWorker = styled.button`
    font-size: 1.6rem;
    padding: 1rem;
    border-radius: 5px;
    background: #252525;
    font-family: 'Ubuntu', sans-serif;
    color: #f3e367;

    &:focus {
        outline: none;
    }
`;

function CreateWorkerButton() {
    return (
        <AddWorker><FontAwesomeIcon icon={faPlusSquare} /> New Worker</AddWorker>   
    )
}

export default CreateWorkerButton
